class Solution(object):
    def minOperations(self, nums, x):
        """
        :type nums: List[int]
        :type x: int
        :rtype: int
        """
        # 0 <= i <= j < n
        # dp[i, j] = (dp[i, j - 1], x - nums[j]) or  (dp[i + 1, j], x - nums[i])
        n = len(nums)
        memo = {}
        def dfs(i, j, target):
            # target is the sum we want from 2 ends
            if i > j:
                return False
            if (i, j, target) in memo:
                return memo[(i, j, target)]
            if dfs(i, j - 1, target - nums[j]) or dfs(i + 1, j, target - nums[i]):
                memo[(i, j, target)]
                return True
        
        return dfs(0, n - 1, x)


